                <li><Link href="">Sign up!</Link></li>
            </ul> */}
            </div>
        </div>
        <div className='footer-bottom'>Copyright © 2004–2023 VGAN Inc. VGAN, VGAN logo, VGAN burst and related marks are registered trademarks of VGAN.</div>
        </footer>

	);
}
